const Navbar = () => {
    return (
        <nav className="navbar">
            <div>
                
            </div>
            
            <div>
                <ul>
                    <a href="/track">Track</a>
                    <a href="/garage">Garage</a>
                    <a href="/bank">Bank</a>
                    <a href="/how-to-play">How to play!</a>
                    <a href="/credits">Credits</a>
                </ul>
            </div>
        </nav>
    );
}
 
export default Navbar;
